        constructor(props){
            super();
            this.state= {
                    title: this.props.title,
                    icon: this.props.Icon,
                    text: this.props.text,
                    brands: this.props.brands
            }
        }
    render() {
        return (
            <div className="parapgrah">

                  <h1>{ (this.state.brands) ? 
                         this.state.brands
                         : ""
                    }
                    <span> <FontAwesomeIcon icon={faUser} /></span></h1>
                <p>
                { (this.state.text) ? 
                         this.state.text
                         : ""
                    }
                </p>
                <div className="brands">
                   { (this.state.brands) ? 
                         this.state.brands
                         : ""
                    }
                </div> 



